&lt;p&gt;The Fourth North American winter storm of 2010 was a powerful nor easter that impacted the Northeastern United States and Eastern Canada from March 12-16, 2010, resulting in at least nine deaths. The slow-moving storm produced over 10 inches (25 cm) of rain in New England, causing widespread flooding of urban and low-lying areas. Winds of up to 70 miles per hour (110 km/h) snapped trees and power lines, resulting in over 1 million homes and businesses left without electricity. The storm also caused extensive coastal flooding and beach erosion. The nor'easter was the fifth major winter storm to impact the Mid-Atlantic and New England in the 2009-10 winter season.&lt;br /&gt;
&lt;br /&gt;
In Connecticut, winds of up to 70 miles per hour (110 km/h) toppled trees and snapped power lines, with the heaviest damage reported in Fairfield County. Falling trees damaged or destroyed several homes in Connecticut, and the destruction was the worst experienced in Fairfield County since Hurricane Gloria struck the state in 1985. At the height of the storm on March 14, more than 110,000 customers were without electricity. By March 16, Connecticut Light and Power (CL&amp;amp;P) reported that 40,000 customers remained in the dark.&lt;br /&gt;
