&lt;p&gt;My Sunset&lt;br /&gt;
&lt;br /&gt;
I close my eyes and I can vision my sunset laid across the water with clouds gently placed on top.&lt;br /&gt;
&lt;br /&gt;
The yellow is so bright that it consumes my thoughts I fall deeper into the colors of the sun so that I could touch the orange glow, what a soft feeling, my sunset.&lt;br /&gt;
&lt;br /&gt;
My sunset takes me to another place and time where there will be no problem to tall to overcome. This vision is imbedded in my mind it is like a river running free a clear thought on a sunny day and it ends with my sunset and me.&lt;br /&gt;
&lt;br /&gt;
My sunset frees my thoughts from confusion it leads me to believe that I am on top of the world, setting me free to score over the waters of my mind.&lt;br /&gt;
&lt;br /&gt;
My sunset places me in a part of heaven where the day comes to an end with the beauty of my sunset.&lt;br /&gt;
&lt;br /&gt;
